import React from "react";

// Define the System interface
interface System {
  _id: string;
  type: string; // 'workflowSystem', 'vendorSystem', 'vehicleSystem'
  workflowItems?: string[]; // Workflow items (for 'workflowSystem')
  vendorName?: string; // Vendor name (for 'vendorSystem')
  vendorClassification?: string; // Vendor classification (for 'vendorSystem')
  vehicleYear?: number; // Vehicle year (for 'vehicleSystem')
  vehicleMake?: string; // Vehicle make (for 'vehicleSystem')
  vehicleModel?: string; // Vehicle model (for 'vehicleSystem')
}

// Props for SystemTable
interface SystemTableProps {
  systems: System[]; // Systems array to display
  onDeleteSystem: (systemId: string) => void; // Delete system handler
  onEditSystem: (systemId: string) => void; // Edit system handler
}

// Main System Table
const SystemTable: React.FC<SystemTableProps> = ({
  systems,
  onDeleteSystem,
  onEditSystem,
}) => {
  return (
    <table className="min-w-full table-auto bg-white shadow-lg">
      <thead>
        <tr>
          <th className="px-4 py-2">System Type</th>
          <th className="px-4 py-2">Details</th>
          <th className="px-4 py-2">Actions</th>
        </tr>
      </thead>
      <tbody>
        {systems.map((system) => (
          <tr key={system._id}>
            <td className="border px-4 py-2">{system.type}</td>
            <td className="border px-4 py-2">
              {system.type === "workflowSystem" &&
                system.workflowItems?.join(", ")}
              {system.type === "vendorSystem" &&
                `${system.vendorName}, ${system.vendorClassification}`}
              {system.type === "vehicleSystem" &&
                `${system.vehicleYear} ${system.vehicleMake} ${system.vehicleModel}`}
            </td>
            <td className="border px-4 py-2">
              <button onClick={() => onEditSystem(system._id)}>Edit</button>
              <button onClick={() => onDeleteSystem(system._id)}>Delete</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default SystemTable;
